page_script({init:function(){$(".map-canvas").each(function(){var b=new google.maps.LatLng($(this).attr("data-latitude"),$(this).attr("data-longitude"));var c={scrollwheel:false,zoom:13,center:b};var d=new google.maps.Map($(this)[0],c);var a=new google.maps.Marker({position:b});a.setMap(d)});$(".ps").click(function(d){var c=$(this);var a=$("#show_ps");a.find(".modal-title").text(c.attr("data-name"));if(c.find(".prod_srv_image").length){a.find(".prod_srv_image").attr("src",c.find(".prod_srv_image").attr("src")).show()}else{a.find(".prod_srv_image").hide()}if(c.attr("data-description")!=""){a.find(".description").text(c.attr("data-description")).show()}else{a.find(".description").hide()}if(c.attr("data-sale-price")!=""){a.find(".sale_price>.price_val").text(c.attr("data-sale-price")).show()}else{a.find(".sale_price").hide()}if(c.attr("data-rent-price")!=""){a.find(".rent_price>.price_val").text(c.attr("data-rent-price"))}else{a.find(".rent_price").hide()}a.modal("show")})}});